import React, { useRef } from "react";
import google from "../../Assets/Icons/pngwing 1.svg";
import apple from "../../Assets/Icons/pngwing 2.svg";
import {
  IconsWrapper,
  OurStoryText,
  OurStoryTextWrapper,
  OurStoryTitle,
  OurStoryWrapper,
} from "./style";
import { IconWrapper, Pngwing2Icon } from "../../pages/style";

const OurStoryPage = () => {
  return (
    <OurStoryWrapper id="about">
      <OurStoryTextWrapper>
        <OurStoryTitle>Our Story</OurStoryTitle>
        <OurStoryText>
        We are a trio of avid travelers, each with a strong engineering background, who came together with a shared passion for exploration. It was during our adventures around the globe that the idea for this incredible application was born.

Inspired to revolutionize the way people discover their surroundings, we embarked on a mission to create a platform that would redefine travel experiences. Our collective engineering expertise became the bedrock for this innovative app, where technology and wanderlust seamlessly intertwine.

Driven by an unwavering appreciation for captivating tourist attractions, we dedicated countless hours to developing a user-centric and feature-rich application. Our ultimate mission: to empower travelers with personalized adventures, all while unlocking exclusive ticket discounts at attractions across the globe.

From the early stages of brainstorming to countless late-night coding sessions, we poured our hearts into crafting an app that embodies our love for travel and the desire to make every journey unforgettable.

Now, as we stand on the brink of launching our creation, we are thrilled to share it with you.

Join us on this incredible journey of exploration and let's make unforgettable memories together â€“ one adventure at a time.
        </OurStoryText>
      </OurStoryTextWrapper>
      <IconsWrapper>
        <img src={google} alt="google" />
        <Pngwing2Icon alt="" src={apple} />
      </IconsWrapper>
    </OurStoryWrapper>
  );
};

export default OurStoryPage;
